        raise ValueError("Inputs must consist only of '0's and '1's.")
    max_len = max(len(a), len(b))
    a = a.zfill(max_len)
    b = b.zfill(max_len)
    result = []
    for x, y in zip(a, b):
        result.append('1' if x != y else '0')
    return ''.join(result)

