def sort_numbers(numbers: str) -> str:
    """ Input is a space-delimited string of numberals from 'zero' to 'nine'.
    Valid choices are 'zero', 'one', 'two', 'three', 'four', 'five', 'six', 'seven', 'eight' and 'nine'.
    Return the string with numbers sorted from smallest to largest
    >>> sort_numbers('three one five')
    'one three five'
    """
    number_map = {
        'zero': 0, 'one': 1, 'two': 2, 'three': 3, 'four': 4,
        'five': 5, 'six': 6, 'seven': 7, 'eight': 8, 'nine': 9
    }
    try:
        words = numbers.strip().split()
        if not all(word in number_map for word in words):
            raise ValueError("Invalid input: contains non-number words.")
        nums = [number_map[word] for word in words]
        nums.sort()
        return ' '.join([key for key, value in number_map.items() if value in nums])
    except Exception as e:
        return f"Error: {str(e)}"

def find_closest_elements(numbers: List[float]) -> Tuple[float, float]:
    if len(numbers) < 2:
        raise ValueError("The list must contain at least two numbers.")
    numbers.sort()
    min_diff = float('inf')
    closest_pair = (numbers[0], numbers[1])
    for i in range(1, len(numbers)):
        diff = numbers[i] - numbers[i-1]
        if diff < min_diff:
            min_diff = diff
            closest_pair = (numbers[i-1], numbers[i])
    return closest_pair

def rescale_to_unit(numbers: List[float]) -> List[float]:
    if not numbers:
        raise ValueError("The input list cannot be empty.")
    if len(numbers) < 2:
        raise ValueError("The input list must contain at least two elements.")
    min_val = min(numbers)
    max_val = max(numbers)
    if min_val == max_val:
        return [0.0 for _ in numbers]
    return [(x - min_val) / (max_val - min_val) for x in numbers]

