def modp(n: int, p: int):
    if p <= 1:
        raise ValueError("Modulus must be greater than 1.")
    result = 1
    base = 2 % p
    while n > 0:
        if n % 2 == 1:
            result = (result * base) % p
        base = (base * base) % p
        n = n // 2
    return result

