def search(lst):
    from collections import Counter
    if not lst:
        return -1
    freq = Counter(lst)
    max_val = -1
    for num in freq:
        if freq[num] >= num and num > max_val:
            max_val = num
    return max_val if max_val != -1 else -1

def triangle_area(a, b, c):
    if a <= 0 or b <= 0 or c <= 0:
        return -1
